import { AppBar, Button, Grid, TextField, Typography } from '@mui/material'
import { styled } from '@mui/material/styles';
import {  Box } from '@mui/system';
import React from 'react'
import Logo from './Logo.ico'





// Custom Textbox
const CTextField = styled(TextField)({
  '& label.Mui-focused': {
    color: '9B3C21',
  },
  '& .MuiInput-underline:after': {
    borderBottomColor: '9B3C21',
    color: '9B3C21',
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'Black',
      color:'black',
      border:'2px solid black'
    },
    // '&:hover fieldset': {
    //   borderColor: 'yellow',
    // },
    '&.Mui-focused fieldset': {
      borderColor: '9B3C21',
      color: '9B3C21',
    },
  },
});
  

const Login = () => {
  return (
    <div>

{/* Container Whole */}
      <Grid
      container
      spacing={0}
      direction="row"
      justifyContent="center"
      alignItems="stretch"
      style={
        {
          minHeight:'100vh'
        }
        }>

{/* Container Logo */}
          <Grid
          item 
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
          xs={12} md={6}>


{/* Picture box */}       
            <Box
            fixed
            component='img'
            sx={{
              width: '80%',
              height: 'auto',
              maxHeight: { xs: 'auto', md: 'auto' },
              maxWidth: { xs: 200, md: '80%' },
            }}
            src={Logo} />
              
            </Grid>


{/* Container Login */}



            <Grid
            item 
            container
            direction="column"
            justifyContent="center"
            alignItems="center"
            xs={12} md={6}>

{/* Container Box */}
              <Box
              sx={{
                width:400,
                height:600,
                backgroundColor: '#ffffff',
                maxHeight: { xs: '500', md: '400' },
                maxWidth: { xs: '350', md: '600' },
                border:"3px solid black",
                borderRadius:2
              }}>

{/* Header */}
              <AppBar position='center'>
                <Typography variant='h5' margin={2}>LOG IN</Typography>
              </AppBar>

{/* Textfield,Login Hyperlink container */}
            <Grid
            item 
            paddingc={2}
            direction="column"
            justifyContent="flex-end"
            alignItems="center">

{/* Email Textbox */}
              <CTextField 
              label='email' 
              placeholder='input email' 
              type='email' 
              fullWidth 
              margin='dense' 
              variant='outlined'/>

{/* Password Textbox */}
              <CTextField 
              label='email' 
              placeholder='input email' 
              type='password' 
              fullWidth 
              margin='dense' 
              variant='outlined'/>

{/* Hyperlink */}
              <Typography variant='h5' href='https://youtu.be/dQw4w9WgXcQ' margin={2}>
              <a href='https://youtu.be/dQw4w9WgXcQ'> forgot password</a></Typography>

{/* Log in Button */}
              <Button variant='outlined' > Log in</Button>


              </Grid>




              </Box>

              </Grid>



           

         

       </Grid>
    </div>
  )
}

export default Login
